import React from 'react'
import {Container, Row, Col, Button, InputGroupText } from "reactstrap";
import { Link } from "react-router-dom";

const ThankYou = () => {
  return (
    <section>
        <Container>
            <Row>
                <Col lg='12'></Col>
            </Row>
        </Container>
    </section>
  )
}

export default ThankYou
